    const {login,username}=useContext(mainContext)
    return(
        <div>
            <div style={{height:100,width:100}}>
            <Spinercorona/> 
            </div>
            
        <div style={{display:'flex',justifyContent:'center',alignItems:'center'}}>
            
             { <Slideshow /> }
       
